#!/usr/bin/env python3# -*- coding: utf-8 -*-"""Author : Mathis PigassouCorrection des Travaux Pratiques :     TP 2 _ fonctions, entrees et sorties, if"""def max2(a: int, b: int) -> int :    '''    Fonction Max entre 2 entiers.    '''    if a >= b :        return a    else :        return b    def fonction1(x: int, y: int, z: int) -> bool :    '''    Si Y est compris entre x et z alors vrai, faux sinon.    '''    if x<= y <= z :         return True    else :        return False    def fonction2(x: int) -> int :    '''    Fonction valeurs absolue    '''    if x >= 0:        return x     else :        return -x        def trinome_v1(a: int, b: int, c: int) -> str :    '''    Fonction trinome sans elif.    '''    if  a == 0 :          if b ==0 :              if c==0:                  return("Infinite de racine")              else :                 return("aucune racine")          else :              return("Une solution simple")    else :        delta = b**2-4*a*c        if delta < 0 :            return("Deux solutions conjugues")        else :            if delta == 0 :                return("Une solution")            else :                return("Deux solutions distinctes")    def trinome_v2(a: int, b: int, c: int) -> str :    '''    Fonction trinome avec elif.    '''    if  a == 0 :          if b ==0 :              if c==0:                  return("Infinite de racine")              else :                 return("aucune racine")          else :              return("Une solution")    else :        delta = b**2-4*a*c        if delta < 0 :            return("Deux solutions conjugues")        elif delta == 0 :            return("Une solution")        else :            return("Deux solutions distinctes")        def max3(a: int,b: int, c: int) -> int :    '''    Renvoie le max entre 3 entiers.    '''    maxi = max2(a,b)    maxi = max2(maxi,c)    return maxidef test() -> None :        # fonction max2    print(max2(-3, -2))         # fonction trinome    print(trinome_v1(4,12,7))    print(trinome_v1(0,0,0))    print(trinome_v1(0,1,1))    print(trinome_v1(1,-2,1))    print(trinome_v1(1,-2,2))    print(trinome_v1(1,3,0))        # fonction max3    print(max3(-1, -5, 4))        